    setValue: function (value) {

        var currentIndex = -1;

        for (var i = 0; i < this.options.values.length; i++) {
            if (value == (this.options.values[i])) {
                currentIndex = i;
            }
        }

        if (currentIndex != -1) {
            this._setValueByClassName(this.options.icons[currentIndex]);
        }
    }

